import React from 'react';
import './Main.scss';
import Header from './components/Header';
import Nav from './components/Nav';

class App extends React.Component{

  render(){

    /* local setup for header componen */
    const logo = ['Online courses','Studying online','How to apply','Course fees','Blog']

    /* local setup for nav component */
    const navs = ['Online courses','Studying online','How to apply','Course fees','Blog']

    return (
      <div>
        <Header />
        <Nav nav={navs}/>
      </div>
    );
  }

}

export default App;
